import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Feed extends Component {
    render() {
        const elements = []
        for (let i = 0; i<10; i++) {
            elements.push(i)
        }
        const divs = []
        for (const[index, value] of elements.entries()) {
            divs.push(<div key={index} className={"post-container"}>{value}</div>)
        }
        return divs
    }
}

class Logo extends Component {
    render() {
        return (
            <div className={"logo-container"}>
                <a href={"https://www.google.de"} className={"logo"}>
                    <svg className={"logo"} id="Layer_1" xmlns="http://www.w3.org/2000/svg" width="33" height="41" viewBox="0 0 33 41">
                        <path className="st0" d="M1 40l30-5.4L1 9.5z"></path>
                        <path className="st0 st0--second" d="M4.6 5.7L31 1 4.5 32.9z"></path>
                    </svg>
                </a>
            </div>
        )
    }
}

class NavToggle extends Component {
    render() {
        return (
            <div className={"nav-toggle-container"}>
                <i className={"nav-toggle-line"}></i>
            </div>
        )
    }
}

class App extends Component {
    render() {
        return (
            <div className={"root-container"}>
                <div className={"feed-container"}>

                    <Feed/>
                </div>
                <div className={"header-container"}>
                    <Logo/>
                    <NavToggle/>
                </div>
            </div>
        )
    }
}

ReactDOM.render(<App/>, document.getElementById('root'))
